import React, { useState } from "react";
import ReactJson from "react-json-view";
import jsonfile from "jsonfile"
import dash from "../../../data/template_dash.json";

import "./generate-component.css";
const GenerateComponent = () => {
    const file = '../../../data/template_dash.json';
const readJSonFile=()=>{
    jsonfile.readFile(file)
    .then(obj => console.dir(obj))
    .catch(error => console.error(error));
  
}
  return (
    <div className="row">
    <button onClick={readJSonFile}>Test generation</button>
      <div className="card  row">
        <h5 className="card-header bg-secondary">Dashboard JSon structure</h5>
        <div className="card-body">
          <ReactJson src={dash} collapsible view="dual" />
        </div>
      </div>
      
    </div>
  );
};

export default GenerateComponent;
